import React from 'react'
import animals from '../photos/animals.jpg';

const styles = {
    backgroundImage: `url(${animals})`,
    height: '100vh',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  };
  
  function Homepage() {
    return (
      <div style={styles}>
        <div className="container h-100">
          <div className="row h-100 align-items-center">
            <div className="col-md-12">
              <h1 className="display-1 text-center mb-5">AniHelp</h1>
              <div className="d-flex justify-content-between">
                <button className="btn btn-primary mr-3">Login</button>
                <button className="btn btn-primary mr-3">Sign up</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
export default Homepage
